import styles from "./Header.module.css"
import Boton from "../Boton"
import logo from "./Logo.png"



function Header() {

    const home=(e)=> {
        location.replace ("../../pages/App/index.js")
    }

    const form=(e)=> {
        setTimeout(() => {
            window.location.replace("../../pages/Formulario/index.js")
        }, 3500);
    }


    return (
        <>
            <div className={styles.header}>
                <img src={logo} alt="Logo Alura Flix" />
                <nav>
                    <Boton className={styles.botonH} onClick={home}
                    >HOME</Boton>
                    <Boton className={styles.botonN} onClick={form }
                    >NUEVO VIDEO</Boton> 
                </nav>
            </div>
            
        </>
    )

}

export default Header
